import React from "react";
import TimerTillNovember from "./TimerTillNovember";

function NoAuthOctoberHomescreen(props) {
  return (
    <header class="masthead">
      <div class="container d-flex h-100 align-items-center">
        <div class="mx-auto text-center">
          <h1 class="mx-auto mt-2 mb-0">No Nut November</h1>
          <h5 class="mx-auto mt-2 mb-0"><em>Where boys become men.</em></h5>
          <TimerTillNovember size={1}/>
          <h5>36,847 comrades</h5>
          <button type="button" class="join-button btn btn-danger main-join-button">Join the boys!</button>
        </div>
      </div>
    </header>

  );
}

export default NoAuthOctoberHomescreen;
